var BoxOpened, Counter, ImgFound, ImgOpened, ImgSource, OpenCard, RandomFunction, ResetGame, ShuffleImages, Source;

console.log('u mnie dzia≈Ça :)');

BoxOpened = '';

ImgOpened = '';

Counter = 0;

ImgFound = 0;

Source = '#boxcard';

ImgSource = ['images/0.png', 'images/1.png', 'images/2.png', 'images/3.png', 'images/4.png', 'images/5.png', 'images/6.png', 'images/7.png', 'images/8.png', 'images/9.png'];

RandomFunction = function(MaxValue, MinValue) {
  return Math.round(Math.random() * (MaxValue - MinValue) + MinValue);
};

ShuffleImages = function() {
  var ImgAll, ImgArr, ImgThis, RandomNumber, i, j, k, len, len1, results, z;
  ImgAll = $(Source).children();
  ImgThis = $(Source + ' div:first-child');
  ImgArr = [];
  for (j = 0, len = ImgAll.length; j < len; j++) {
    i = ImgAll[j];
    ImgArr[i] = $('#' + ImgThis.attr('id') + ' img').attr('src');
    ImgThis = ImgThis.next();
  }
  ImgThis = $(Source + ' div:first-child');
  results = [];
  for (k = 0, len1 = ImgAll.length; k < len1; k++) {
    z = ImgAll[k];
    RandomNumber = RandomFunction(0, ImgArr.length - 1);
    $('#' + ImgThis.attr('id') + ' img').attr('src', ImgArr[RandomNumber]);
    ImgArr.splice(RandomNumber, 1);
    results.push(ImgThis = ImgThis.next());
  }
  return results;
};

ResetGame = function() {
  ShuffleImages();
  $(Source + ' div img').hide();
  $(Source + ' div').css('visibility', 'visible');
  Counter = 0;
  $('#success').remove();
  $('#counter').html('' + Counter);
  BoxOpened = '';
  ImgOpened = '';
  ImgFound = 0;
  return false;
};

OpenCard = function() {
  var CurrentOpened, id;
  id = $(this).attr('id');
  if ($('#' + id + ' img').is(':hidden')) {
    $(Source + ' div').off('click');
    $('#' + id + ' img').slideDown('fast');
    if (ImgOpened === '') {
      BoxOpened = id;
      ImgOpened = $('#' + id + ' img').attr('src');
      setTimeout((function() {
        return $(Source + ' div').on('click', OpenCard);
      }), 300);
    } else {
      CurrentOpened = $('#' + id + ' img').attr('src');
      if (ImgOpened !== CurrentOpened) {
        setTimeout((function() {
          $('#' + id + ' img').slideUp('fast');
          BoxOpened = '';
          return ImgOpened = '';
        }), 400);
      } else {
        $('#' + id + ' img').parent().css('visibility', 'hidden');
        $('#' + BoxOpened + ' img').parent().css('visibility', 'hidden');
        ImgFound++;
        BoxOpened = '';
        ImgOpened = '';
      }
      setTimeout((function() {
        return $(Source + ' div').on('click', OpenCard);
      }), 400);
    }
    Counter++;
    $('#counter').html('' + Counter);
    if (ImgFound === ImgSource.length) {
      return $('#counter').prepend('<span id="success">You found all pictures with </span>');
    }
  }
};

$(function() {
  var j, results, y;
  results = [];
  for (y = j = 1; j <= 2; y = ++j) {
    $.each(ImgSource, function(i, val) {
      return $(Source).append('<div id=card' + y + i + '><img src' + val + ' />');
    });
    $(Source + ' div').on('click', OpenCard);
    results.push(ShuffleImages());
  }
  return results;
});

